import {
    USER_LOADER
} from '../actions/constants'


export const getAllOptions = () => async (dispatch) => {
    try{       
        console.log('options =====>');
        dispatch({type: ALL_OPTIONS, payload: all_options});
    } catch(error) {
        console.log('Error=>'+error)
    }
}

export const signup = (assetValues) => async (dispatch, getState) => {
    console.log('Action==>'+assetValues);
    dispatch({type:USER_LOADER, payload: false});
}
